import {
    BrowserRouter as Router,
    Link
} from "react-router-dom";
import { FaBars } from "react-icons/fa"


const hamburger = <html lang="en">
<head>
    <meta charset="UTF-8"/>
    <meta http-equiv="X-UA-Compatible" content="IE=edge"/>
    <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
    <title>Document</title>
</head>
<body>
    
</body>
</html>

const NavBar = ({handleLogout}) => {
    return ( 
        <nav>
                    <Link to="/"><img src="favicon.ico" alt="" /></Link>
                    <button className="hamburger" id="hamburger"><FaBars /></button>
                    <ul>
                        <Link to="/DiceGame">Dice Game</Link>
                        <Link to="/JumpGame">Jump Game</Link>
                        <Link to="/SnakeGame">Snake Game</Link> 
                    </ul>
                    <button className="logout" onClick={handleLogout}>Logout</button>
                </nav>
     );
}
 
export default NavBar;
